/* 最大长度子字符串 */
function subStringLength (str) {
  var i = 0;
  var j = 0;
  var san = 0;
  var len = str.length;
  var cur = '';
  while (j < len) {
    // 存在
    if (cur.indexOf(str.charAt(j)) > -1) {
      cur = cur.substr(1);
      i ++;
    } else {
      cur = cur + str.charAt(j);
      j ++;
      san = Math.max(san, j - i);
    }
  }
  return san;
}

